function InterpolarVariablesEnComponentes() {
  const libros = ["Harry Potter", "Juego de Tronos", "Clean Code"];
  
  return (
    <>
      <hr/>
        InterpolarVariablesEnComponentes.js
      <hr/>
      <ul>
        {
          libros.map(libro => {
            return <li>{libro}</li>
          })
        }
      </ul>
    </>
  )
}

export default InterpolarVariablesEnComponentes;
